import React from "react";
import './styles/WaitingRoom.css';
const WaitingRoom = () => {
    return(
        <div className="WaitingRoom">
            <div id="waiting-room">
                <div className="info-block">
                    <h3>Участники</h3>
                    <div className="players-panel">
                        
                    </div>
                </div>
            </div>
        </div>
    )
}

export default WaitingRoom;
